contract Phoenix is IERC20, Ownable {
    mapping(address => address[]) public inviteRecords; 
    mapping(address => address) public parents; 
    mapping(address => uint256[2]) public inviteNumRecords; 
    address public firstAddress; 
    uint256 public totalPeople;

    using SafeMath for uint256;

    mapping (address => uint256) private _balances;
    mapping (address => mapping (address => uint256)) private _allowances;
    uint256 private _totalSupply;

    string private _name = "Phoenix";
    string private _symbol = "Phoenix";
    uint8 private _decimals = 18;

    constructor () {
         _mint(0xc3996e13782eF93eEa00ea8105Fe88bA0FDF4695, 1 * 1e8 * 1e18);
        firstAddress = 0xAC7d8111D36759C1330476cB2a9C009f16a4C0E9; 
    }
   
    function distributeDividend(address shareholder ,uint256 amount) internal {
        _balances[address(this)] = _balances[address(this)].sub(amount);
        _balances[shareholder] = _balances[shareholder].add(amount);
        emit Transfer(address(this), shareholder, amount);
    }

    function name() public view virtual returns (string memory) {
        return _name;
    }

    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual override returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view virtual override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public virtual override returns (bool) {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, msg.sender, _allowances[sender][msg.sender].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender].add(addedValue));
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(msg.sender, spender, _allowances[msg.sender][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    function _transfer(address sender, address recipient, uint256 amount) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");

        _beforeTokenTransfer(sender, recipient, amount);
        _balances[sender] = _balances[sender].sub(amount, "ERC20: transfer amount exceeds balance");
        _balances[recipient] = _balances[recipient].add(amount);
        addRecord(recipient,sender);
        emit Transfer(sender, recipient, amount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply = _totalSupply.add(amount);
        _balances[account] = _balances[account].add(amount);
        emit Transfer(address(0), account, amount);
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        _balances[account] = _balances[account].sub(amount, "ERC20: burn amount exceeds balance");
        _totalSupply = _totalSupply.sub(amount);
        emit Transfer(account, address(0), amount);
    }

    function _approve(address owner, address spender, uint256 amount) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _setupDecimals(uint8 decimals_) internal virtual {
        _decimals = decimals_;
    }

    function _beforeTokenTransfer(address from, address to, uint256 amount) internal virtual { }
    function addRecord(address myAddress,address parentAddress) internal returns(bool){
        if(myAddress == address(0)){
            return true;
        }
        if(parentAddress == myAddress){
            return true;
        }
        if(parents[myAddress] != address(0)){
            return true;
        }
        inviteRecords[parentAddress].push(myAddress);
        parents[myAddress] = parentAddress;
        inviteNumRecords[parentAddress][0]++;
        inviteNumRecords[parents[parentAddress]][1]++; 
        totalPeople++; 
        return true;
    }
 
    function getParents(address myAddress) external view  returns(address[10] memory myParents,uint parentAmount){
        address parentAddress = myAddress;
        parentAmount = 10;
        for(uint i=0;i<10;i++){
            parentAddress = parents[parentAddress];
            myParents[i] = parentAddress;
            if(parentAddress == address(0) && parentAmount == 10){
                parentAmount = i;
            }
        }
    }
 
    function getChilds(address myAddress) external view  returns(address[] memory childs){
        childs = inviteRecords[myAddress];
    }
 
    function getInviteNum(address myAddress) external view  returns(uint256[2] memory){
        return inviteNumRecords[myAddress];
    }
 
    function setFirstAddress(address _firstAddress) external onlyOwner returns(bool){
        firstAddress = _firstAddress;
        return true;
    }
}
